      allCountries: [],
      filteredCountries: [],
    };
  }

  async componentDidMount() {
    const countries = await fetch('https://restcountries.eu/rest/v2/all');
    const json = countries.JSON();

    console.log(json);
  }

  render() {
    return <div></div>;
  }
}
